import React from "react";
import styles from "./header.module.css";
const AppHeader = () => {
    return (
      <header className={styles.header}>
        <div className={styles.leftBlock1}>Left Block 1</div>
        <div className={styles.leftBlock2}>Left Block 2</div>
        <div className={styles.centerBlock}>Center Block</div>
        <div className={styles.rightBlock}>Right Block</div>
      </header>
    );
}
export default AppHeader;
